function copyLessonButtons(){var e=document.getElementsByClassName("branchbuttoncontainer")[0];if(null==e)window.setTimeout(copyLessonButtons,100);else{var t=document.getElementById("lesson-branch-top-nav");if(t&&e){var n=e.cloneNode(!0);t.appendChild(n)}}}function setPdfFrameHeight(){var e=document.getElementById("lesson-pdf-frame"),t=e.contentDocument,n=t.getElementById("viewer").offsetHeight;0==n?window.setTimeout(setPdfFrameHeight,100):document.getElementById("lesson-pdf-div").style.height=n+"px"}